        import React from "react";
        import 'bootstrap/dist/css/bootstrap.min.css';
        import Navbar from 'react-bootstrap/Navbar';
        import Nav from 'react-bootstrap/Nav';
        import Container from 'react-bootstrap/Container';
        import image from '../../../src/assets/nob3.png';

        function Header(){
            return(
                <>
                
                <Navbar bg= "ligth" variant="ligth">
                    <Container>
                        <Navbar.Brand href= "#home">
                            <img src={image}  width="150" height="150" className="d-inline-block align-top" alt="React Bootstrap logo"/> 
                        </Navbar.Brand>
                        <Nav className ="me-auto">
                            <Nav.Link href ="#home">Home</Nav.Link>
                            <Nav.Link href ="#features">Store</Nav.Link>
                            <Nav.Link href ="#pricing">About Us</Nav.Link>    
                        </Nav>
                    </Container>    
                </Navbar>
                </>
                

                // <div className="container">
                    
                //     <header className="d-flex flex-wrap justify-content-center py-3 mb-4 border-bottom navbar-custom">
                //     <ul class="nav nav-pills">
                //         <li class="nav-item"><a href="#" class="nav-link active" aria-current="page">Home</a></li>
                //         <li class="nav-item"><a href="#" class="nav-link">Features</a></li>
                //         <li class="nav-item"><a href="#" class="nav-link">Pricing</a></li>
                //         <li class="nav-item"><a href="#" class="nav-link">FAQs</a></li>
                //         <li class="nav-item"><a href="#" class="nav-link">About</a></li>
                //     </ul>                                        
                    
                
                //     </header>
                // </div>
                
            );
        }

        export default Header;
